import NavBarRHome from "../navbars/NavBarHome";
import '../css/Home.css';


function Home() {



    return (
        <form className="HomeBg">
        <div className="container">
            <NavBarRHome />

            
            <div class="alert alert-info">
                <strong><h1>Welcome to car rental system</h1></strong> 
            </div>





        </div>
        </form>
    )

}
export default Home;
